import Link from 'next/link';

const Detail = ({}) => {
  return (
    <>
      <Link href="/index">
        <a>Index</a>
      </Link>
      <div>detail</div>
    </>
  );
};

Detail.getInitialProps = async ({ ctx }) => {};

export default Detail;
